import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import  chat  from './components/chat'
import login from './components/login';
function App() {
  return (
    <div className="App">
    <Router>
      <Switch>
        <Route path="/room">
          <chat/>
        </Route>
        <Route path="/">
          <login/>
        </Route>
      </Switch>
    </Router>
    </div>
  );
}

export default App;
